import React from 'react';

const Home = () => {
    return (
        <div>
            <h1>Welcome to Our Website!</h1>
            <p>We are glad to have you here. Explore our services and learn more about us.</p>
            <h2>Overview of Services</h2>
            <ul>
                <li>Service 1: Description of service 1.</li>
                <li>Service 2: Description of service 2.</li>
                <li>Service 3: Description of service 3.</li>
            </ul>
        </div>
    );
};

export default Home;
